  text-align: center;
  line-height: 70px;
  color: #FFF;
  cursor: pointer;
  background-size: 70%; /* Resize image to fit button area */
  background-repeat: no-repeat; /* Prevent image repetition */
  background-position: center;
}

.button__prev,
.button__next {
  display: inline-block;
  height: 50px;
  width: 50px;
  background: #7C60FF;
  border-radius: 50%;
  box-shadow: 0 0 1px rgb(193, 193, 193);
  font-size: 32px;
  text-align: center;
  line-height: 50px;
  color: #FFF;
  vertical-align: bottom;
  cursor: pointer;
  -webkit-transition: all 300ms ease;
  transition: all 300ms ease;
  background-size: 70%; /* Resize image to fit button area */
  background-repeat: no-repeat; /* Prevent image repetition */
  background-position: center;
}

.button__prev {
  background-image: url("/46501a27979bce63b1b408f09ceef933.png");
}

.button__next {
  background-image: url("/8ae64f1799f053a3915141ff53852460.png");
}

.button__pause.play {
  background-image: url("/2d569858b4300f47b7133f36063c5c93.png");
}

.button__pause.pause {
  background-image: url("/281551552f32d1a37062764dd322f354.png");
}

input[type=range] {
  -webkit-appearance: none;
  background-color: silver;
  width: 300px;
  height: 5px;
  border-radius: 3px;
  margin: 30px 0;
}

input[type=range]::-webkit-slider-thumb {
  background-color: #7C60FF;
  width: 20px;
  height: 20px;
  border-radius: 10px;
}

.display {
  display: none;
}

/* Feel free to change duration  */
.animated {
  animation-duration: 100ms;
  animation-fill-mode: both;
}

